import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <table>
      <h1> Form Pembelian Buah</h1>
      <tr>
      <td><b>Nama Pelanggan</b></td>
      <td> <input type="text" name="pelanggan" /> </td> <br></br>
      </tr>

      <td><b>Daftar Item</b></td>
      <td><input type="checkbox" name="daftar1" value="semangka" /> Semangka </td> <br></br>
      <td><input type="checkbox" name="daftar2" value="jeruk" /> Jeruk </td> <br></br>
      <td><input type="checkbox" name="daftar3" value="nanas" /> Nanas </td> <br></br>
      <td><input type="checkbox" name="daftar4" value="salak" /> Salak </td> <br></br>
      <td><input type="checkbox" name="daftar5" value="anggur" /> Anggur </td> <br></br>
      </table>

    </div>


  );
}

export default App;
